import React from 'react';
import { Slideshow } from "@components";

const HomePage = () => {
  return (
    <div className="container">
      <h1 className="text-center">Home Page</h1>
      <div classMName="slideshow-container">
        <Slideshow />
      </div>
    </div>
  );
};

export default HomePage;
